import React from "react";
import { BrowserRouter as Router, Routes, Route } from "react-router-dom";
import { Button } from "@mui/material";
import { Stage, Layer, Rect } from "react-konva"; // Import Konva components
import LoginPage from "./pages/LoginPage";
import WhiteboardSelectionPage from "./pages/WhiteboardSelectionPage";

function App() {
  return (
    <Router>
      <div style={{ padding: "20px" }}>
        <Button
          variant="contained"
          color="primary"
          style={{ marginBottom: "20px" }}
        >
          Test MUI Button
        </Button>

        {/* Konva Canvas Setup */}
        <Stage width={window.innerWidth} height={window.innerHeight * 0.6}>
          <Layer>
            {/* Add a simple rectangle to test Konva rendering */}
            <Rect
              x={20}
              y={20}
              width={100}
              height={100}
              fill="lightblue"
              draggable
            />
          </Layer>
        </Stage>

        <Routes>
          <Route path="/" element={<LoginPage />} />
          <Route path="/whiteboards" element={<WhiteboardSelectionPage />} />
        </Routes>
      </div>
    </Router>
  );
}

export default App;
